data1 = ""
test1 = ""

print(hamming(data1, test1))


def hamdist(str1, str2):
    """Count the # of differences between equal length strings str1 and str2"""

    diffs = 0
    for ch1, ch2 in zip(str1, str2):
        if ch1 != ch2:
            diffs += 1
    return diffs
print(hamdist(data1, test1))